function validate(){var t=document.getElementById("ip1"),a=document.getElementById("ip2"),l=document.getElementById("ip3"),i=document.getElementById("ip4");if(!(isNaN(t.value)||isNaN(a.value)||isNaN(l.value)||isNaN(i.value))){let e=t.value+"."+a.value+"."+l.value+"."+i.value;e.match(/^(?:(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)\.){3}(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)$/)?window.location.href="/Geo/"+e:alert("IP that we received is wrong")}}